import './css/App.css'
import './css/colors.css'
import Navbar from './navbar'

function App() {
    axios.get(localStorage.getItem('url') + '/about.json')
    .then(function (res) {
        console.log(res);
    })
    .catch(function (err) {
        console.log(err)
    });

    return (
        <div className="App">
            <Navbar />
        </div>
    );
}

export default App;
